import { Routes, Route, useLocation } from 'react-router-dom';
import ProfileSearch from './ProfileSearch';

function App() {

    return (
        <>
        <p>Hi!</p>
            <Routes>
                <Route path="/" element={<ProfileSearch />} />
            </Routes>
        </>
    );
}
export default App;
